import React from "react";

import { ContactList, ContactIcon, ContactText } from "./PageElements";
import mailIcon from "../assets/mailIcon.png";
import phoneIcon from "../assets/phoneIcon.png";
import githubIcon from "../assets/githubIcon.png";
import linkedInIcon from "../assets/linkedInIcon.png";
const Contact = () => {
  return (
    <div style={{ textAlign: "center", paddingTop: "2em" }}>
      <h1>I'd love to talk</h1>
      <ContactList>
        <li>
          <ContactIcon src={mailIcon} /> <ContactText>davis.con@northeastern.edu</ContactText>
        </li>
        <li>
          <ContactIcon src={phoneIcon} style={{width: "60px",     marginLeft: "-6px"}}/> <ContactText>631.935.4505</ContactText>

        </li>
        <li>
          <ContactIcon src={githubIcon} /><ContactText>conDavis</ContactText>
        </li>
        <li>
          <ContactIcon src={linkedInIcon}/><ContactText>Constance Davis</ContactText>
        </li>
      </ContactList>
    </div>
  );
};

export default Contact;
